import './App.css';
import { HashRouter } from "react-router-dom";
import { Routes, Route} from "react-router";


function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/Labs/*" element={<>HI</>} />
        <Route path="/Kanbas/*" element={<>HII</>} />
        <Route path="/hello" element={<>HIII</>} />
      </Routes>
      <div className="App">
        Losers web
      </div>
    </HashRouter>

  );
}

export default App;
